import { useState, useEffect } from 'react';

function App() {

  const [receta, setReceta] = useState([])

  useEffect(() => {
    fetch("https://www.themealdb.com/api/json/v1/1/random.php")
      .then((response) => {
        return response.json()
      })
      .then((receta) => {
        setReceta(receta)
      })
  }, [])

  return (
    <div>
      {receta.meals.map((item)=>{
        console.log(item)
      })}
    </div>
  );
}
export default App;
